import React from "react";
import {Navbar, Nav, NavDropdown, Container} from "react-bootstrap";
import classes from "../CSS/navbar2.module.css";
import { NavLink} from "react-router-dom";
import {Link} from "react-scroll";

const CustomNavbar2 = ()=>{
    return(
        <>
        <Container>
        <div>
        <Navbar style={{fontFamily:"Lexend Giga",backgroundColor:"#F5F5F5",marginBottom:"20px"}} bg="light" expand="lg" fixed="top">
        <Nav style={{margin:"0 0 0 auto"}} className="navlinks">
                    <NavLink className={classes.mynavlinks} to="/">Home</NavLink>
                
        </Nav>
        
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
            
        </Navbar>
        </div>
        </Container>
        </>
    )
}
export default CustomNavbar2;
